%[text] # SRP contour plot
%[text] ## ref.
%[text] polarplot3dをMATLAB file exchangeからダウンロードする必要あり
clc
clear
cls

format long
%[text] ## satelltie configuration
nFacet = 1;
sat.pos = [0 0 0];
sat.normal = [0 0 1];
sat.area = 1;

testCase = 1 %[output:8be24077]

sat.mCT = 0.1;
sat.nu = 100; % 100 or 800
sat.nv = 50;
sat.F0 = 0.5 .* ones(nFacet, 1);
sat.rho = 0.5 .* ones(nFacet, 1);
%[text] ## parameters
const = orbitConst;
d = au2km(1.0, const) * 10^3; % m, distance from sat to sun
dAU = km2AU(d ./ 10^3, const); % AU
S0 = const.S0; % Solar constant, W/m^2
c = const.c; % light speed, m/s
coeff = -S0 / c / dAU^2;
%%
%[text] ## specular
%[text] sun vector (from satellite to Sun): ${\\bf s} = \[\\cos\\phi\_i \\sin\\theta\_i, \\sin\\phi\_i, \\sin\\theta\_i, \\cos\\theta\_i\]^T$
phiIrange = deg2rad(0):deg2rad(5):deg2rad(360);
thetaIrange = 0:deg2rad(3):deg2rad(89);
[phiI, thetaI] = meshgrid(phiIrange, thetaIrange);

% pre-allocation
srpCsTrueX = zeros(size(phiI));
srpCsTrueY = zeros(size(phiI));
srpCsTrueZ = zeros(size(phiI));
srpCsApproxX = zeros(size(phiI));
srpCsApproxY = zeros(size(phiI));
srpCsApproxZ = zeros(size(phiI));


for i = 1:size(phiI,1)
    for j = 1:size(phiI, 2)
        phi = phiI(i,j);
        theta = thetaI(i,j);
        sunB = [sin(theta)*cos(phi), sin(theta)*sin(phi), cos(theta)];
        NS = sat.normal * sunB';
        sunlitFlag = (sat.normal * sunB' > 0); % nFacetx1 matrix, 1: sunlit, 0: shade
%[text] ### true (numerically)
                [sat, ~, tmp] = srpAS(sat, sunB, d, const, 10^5);
%         [sat, ~, tmp] = srpCT(sat, sunB, d, const);
        srpCsTrueX(i,j) = tmp(1) / abs(coeff);
        srpCsTrueY(i,j) = tmp(2) / abs(coeff);
        srpCsTrueZ(i,j) = tmp(3) / abs(coeff);

    end
end

%%
%[text] ## show figures
%[text] ### color range
% adaptive range
cxRange = [min(srpCsTrueX, [], 'all') max(srpCsTrueX, [], 'all')]
cyRange = [min(srpCsTrueY, [], 'all') max(srpCsTrueY, [], 'all')]
czRange = [min(srpCsTrueZ, [], 'all') max(srpCsTrueZ, [], 'all')]

% fixed range
% cxRange = [-0.1e-5 0.1e-5];
% cyRange = [-1e-6 1e-6];
% czRange = [-0.25e-5 0];
%[text] ### contour
% figure
% subplot(1,2,1)
% [~, cTrueX] = contourf(cos(phiI).*sin(thetaI), sin(phiI).*sin(thetaI), srpCsTrueX, 10);
% colorbar
% clim([-1e-6 1e-6])
% axis equal
% view([0 90])
% subplot(1,2,2)
% [~, cApproxX] =contourf(cos(phiI).*sin(thetaI), sin(phiI).*sin(thetaI), srpCsApproxX);
% set(cApproxX, 'LevelList' ,cTrueX.LevelList);
% colorbar
% clim([-1e-6 1e-6])
% % title('absolute error')
% axis equal
% xlabel('x'), ylabel('y')
% view([0 90])
%
% figure
% subplot(1,2,1)
% [~, cTrueY] = contourf(cos(phiI).*sin(thetaI), sin(phiI).*sin(thetaI), srpCsTrueY, 10);
% colorbar
% clim([-1e-6 1e-6])
% axis equal
% view([0 90])
% subplot(1,2,2)
% [~, cApproxY] = contourf(cos(phiI).*sin(thetaI), sin(phiI).*sin(thetaI), srpCsApproxY);
% set(cApproxY, 'LevelList' ,cTrueY.LevelList);
% colorbar
% clim([-1e-6 1e-6])
% % title('absolute error')
% axis equal
% xlabel('x'), ylabel('y')
% view([0 90])
%
% figure
% subplot(1,2,1)
% [~, cTrueZ] = contourf(cos(phiI).*sin(thetaI), sin(phiI).*sin(thetaI), srpCsTrueZ, 10);
% colorbar
% clim([-2.5e-6 0])
% axis equal
% view([0 90])
% subplot(1,2,2)
% [~, cApproxZ] = contourf(cos(phiI).*sin(thetaI), sin(phiI).*sin(thetaI), srpCsApproxZ);
% set(cApproxZ, 'LevelList' ,cTrueZ.LevelList, 'lineStyle','--');
% colorbar
% clim([-2.5e-6 0])
% % title('absolute error')
% axis equal
% xlabel('x'), ylabel('y')
% view([0 90])

%[text] ## Surf
figure %[output:9665c7de]
subplot(1,3,1) %[output:9665c7de]
surf(cos(phiI).*sin(thetaI), sin(phiI).*sin(thetaI), srpCsTrueX, EdgeColor = 'none') %[output:9665c7de]
view([0 90]) %[output:9665c7de]
clim(cxRange) %[output:9665c7de]
axis equal %[output:9665c7de]

subplot(1,3,2) %[output:9665c7de]
surf(cos(phiI).*sin(thetaI), sin(phiI).*sin(thetaI), srpCsTrueY, EdgeColor = 'none') %[output:9665c7de]
view([0 90]) %[output:9665c7de]
clim(cyRange) %[output:9665c7de]
axis equal %[output:9665c7de]

subplot(1,3,3) %[output:9665c7de]
surf(cos(phiI).*sin(thetaI), sin(phiI).*sin(thetaI), srpCsTrueZ, EdgeColor = 'none') %[output:9665c7de]
view([0 90]) %[output:9665c7de]
clim(czRange) %[output:9665c7de]
axis equal %[output:9665c7de]
%[text] ### Polar plot

figure %[output:5ed1a55f]
polarplot3d(srpCsTrueX, 'GridStyle', '--', 'PolarGrid', {9 8}, 'PlotType', 'surfn'); %[output:5ed1a55f]
view([0 90]); axis equal %[output:5ed1a55f]
clim(cxRange) %[output:5ed1a55f]

figure %[output:11096d91]
polarplot3d(srpCsTrueY, 'GridStyle', '--', 'PolarGrid', {9 8}, 'PlotType', 'surfn'); %[output:11096d91]
view([0 90]); axis equal %[output:11096d91]
clim(cyRange) %[output:11096d91]

figure %[output:6ac9d274]
polarplot3d(srpCsTrueZ, 'GridStyle', '--', 'PolarGrid', {9 8}, 'PlotType', 'surfn'); %[output:6ac9d274]
view([0 90]); axis equal %[output:6ac9d274]
clim(czRange) %[output:6ac9d274]

figure %[output:69618631]
tiledlayout(3,1), nexttile %[output:69618631]
plot(rad2deg(thetaI(:,1)), srpCsTrueX(:,1),'r'), hold on %[output:69618631]
% ylim([-3e-6 0])
nexttile %[output:69618631]
plot(rad2deg(thetaI(:,1)), srpCsTrueY(:,1),'r'), hold on %[output:69618631]
% ylim([-3e-6 0])
nexttile %[output:69618631]
plot(rad2deg(thetaI(:,1)), srpCsTrueZ(:,1),'r'), hold on %[output:69618631]
% ylim([-3e-6 0])

